import React from 'react';
import TextTitle from '../../atoms/TextTitle';

export default function ClientList({ customers }) {
  <div>
    <table>
      <thead>
        <tr>
          <th>Clientes</th>
        </tr>
      </thead>
      <tbody>
        {customers.map((e, index) => {
          <tr key={ index }>
            <td>
              <TextTitle />
            </td>
          </tr>;
        })}
      </tbody>
    </table>
  </div>;
}
